package com.retailstore.discountservice.model;import com.retailstore.discountservice.constant.ItemType;import jakarta.persistence.Entity;import jakarta.persistence.GeneratedValue;import jakarta.persistence.GenerationType;import jakarta.persistence.Id;import lombok.*;@Entity@Getter@Setter@NoArgsConstructor@AllArgsConstructorpublic class Item {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private Long id;    private String itemName;    private String itemDescription;    private Double itemPrice;    private ItemType itemType;}